import React ,{ useEffect} from "react";
import Register from "./components/Login/Register";
import { Route, Routes } from "react-router-dom";
import Home from "./components/Home/Home";
import AboutUs from "./components/About/AboutUs";
import ContactUs from "./components/Contact/ContactUs";
import Problem from "./components/Problem/Problem";
import LogIn from "./components/Login/LogIn";
import Alumini from "./components/Alumini/MainContainer";
import Error from "./components/Error/Error";
import SignUp from "./components/Login/SignUp";
import Account from "./components/Account/Account"
import Contest from "./components/Contest/Contest";
import JobApply from "./components/Home/JobApply";

import { AnimatePresence } from "framer-motion";
import { getAllDetails } from "./utils/firebaseFunctions";
import { useStateValue } from "./context/StateProvider";
import { actionType } from "./context/reducer";
import ContestRegistration from "./components/Contest/ContestRegistration";
import Profile_detail_con from "./components/Profile_detail_con";
import Quora from "./components/Quora/Quora";

export default function App() {
  const [{ details }, dispatch] = useStateValue();

  const fetchData = async () => {
    await getAllDetails().then((data) => {
      dispatch({
        type: actionType.SET_DETAILS,
        details: data,
      });
    });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>
      <AnimatePresence>
        <main>
          <Routes>
            <Route path="/home" element={<Home />} exact />
            <Route path="about" element={<AboutUs />} exact />
            <Route path="contact" element={<ContactUs />} exact />
            <Route path="problem" element={<Problem />} exact />
            <Route path="alumini" element={<Alumini />} exact />
            <Route path="/" element={<LogIn />} exact />
            <Route path="register" element={<Profile_detail_con />} exact />
            <Route path="signup" element={<SignUp />} exact />
            <Route path="account" element={<Account />} exact />
            <Route path="contest" element={<Contest />} exact />
            <Route path="jobApply" element={<JobApply />} exact />
            <Route path="contestRegister" element={<ContestRegistration />} exact />
            <Route path="discuss" element={<Quora />} exact />
            <Route path="*" element={<Error />} />
          </Routes>
        </main>
      </AnimatePresence>
    </div>
  );
}
